import { Navigate, Outlet } from "react-router-dom";
import { useAuth } from "../context/AuthProvider";

export default function CheckAuth() {
    const { auth } = useAuth();

    if (auth.accessToken) console.log('yah')
    else { console.log('nah') }

    return (
        auth?.accessToken
            ? <Navigate to="/" />
            : <Navigate to="/login" />
    )
}
